select(2, ...).LoadData("APP_INFO","Global",[[return {version=405,lastSync=1604492539,message={id=0,msg=""},news={{title="TradeSkillMaster v4.10.14 Changelog",content="TSM v4.10.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed tooltip error when hovering over favorite searches<br />* Fixed error on base group UI after removing a group<br />* Fixed TSM taking a long time on logout for some users<br />* [Retail] Added additional bonusIds<br />* [Retail] Added light/rich illusion dust conversion<br />* [Retail] Updated ink trading for Shadowlands<br />* [Retail] Fixed error when syncing professions between accounts<br />* [Retail] Fixed error when creating profession groups<br />* [Retail] Fixed issue with &#8220;/disenchant&#8221; search filter<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1604257412,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-14-changelog/"},{title="TradeSkillMaster v4.10.13 Changelog",content="TSM v4.10.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with some items causing My Auctions to not load properly<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1603080676,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-13-changelog/"},{title="TradeSkillMaster v4.10.12 Changelog",content="TSM v4.10.12 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with some items causing My Auctions to not load properly<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1603060177,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-12-changelog/"},{title="TradeSkillMaster v4.10.11 Changelog",content="TSM v4.10.11 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with some items causing My Auctions to not load properly<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1603056749,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-11-changelog/"},{title="TradeSkillMaster v4.10.10 Changelog",content="TSM v4.10.10 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Added new bonusIds for 4.10.10 to porperly track different levels of weapons / armor<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1602984270,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-10-changelog/"},{title="TradeSkillMaster v4.10.9 Changelog",content="TSM v4.10.9 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Added workaround for AH bugs in 9.0.1<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1602636041,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-9-changelog/"},{title="TradeSkillMaster v4.10.8 Changelog",content="TSM v4.10.8 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Initial support for patch 9.0.1<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1602630062,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-8-changelog/"},{title="TradeSkillMaster v4.10.7 Changelog",content="TSM v4.10.7 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Various performance improvements when using NumInventory / SmartAvgBuy sources<br />* Fixed error when viewing Crafting UI<br />* Fixed error from account syncing<br />* Fixed player gold tooltip error<br />* Fixed error when Destroying while posting items via Browse<br />* [Retail] Re-added support for using Auctionator prices<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1601850508,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-7-changelog/"}}}]]) --<APP_INFO,Global,1604492539>
